import logo from "../src/assets/logo/logo.pn";

export default function App() {
  return (
    <div className="">
      <header className="w-[144px] h-[140px] bg-white">
        <div>
          <div>
            <img src={logo} className="w-[140px]" alt="logo" />
          </div>
        </div>
      </header>
    </div>
  );
}
